import React, {Component} from "react";
import logo from './logo.svg';
import './App.css';
import Navigation from './Navbar.js';
import 'bootstrap/dist/css/bootstrap.min.css';
// import { Navbar, Nav, NavItem, NavDropdown, MenuItem, Button, Form, FormControl} from 'react-bootstrap';


function App() {
  return (
    <div className="App">
      <Navigation/>
      <Route  path="/plantInfo" component={PlantInfo}  />
      <header className="App-header">
          EmPoweringKnowledge offers information on different types of energy consumption in each state, 
          in combination with Congress membersâ€™ sponsorship and voting for energy-related bills.
        
      </header>
    
      
    </div>
  );
}

export default App;
